43e\u0434 \u0412\u043e\u043b\u043e\u0447\u0430\u0435\u0432\u043a\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924\" class=\"mw-redirect\" title=\"1924\">1924<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> \u0432 \u0441\u043e\u043f\u0440\u043e\u0432\u043e\u0436\u0434\u0435\u043d\u0438\u0438 \u043e\u0440\u043a\u0435\u0441\u0442\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B0%D0%B9%D1%82%D0%BC%D0%B0%D0%BD,_%D0%9F%D0%BE%D0%BB\" title=\"\u0423\u0430\u0439\u0442\u043c\u0430\u043d, \u041f\u043e\u043b\">\u041f\u043e\u043b\u0430 \u0423\u0430\u0439\u0442\u043c\u0430\u043d\u0430<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0438\u0441\u043f\u043e\u043b\u043d\u0435\u043d\u043e \u043e\u0434\u043d\u043e \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u0445 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6_%D0%93%D0%B5%D1%80%D1%88%D0%B2%D0%B8%D0%BD\" class=\"mw-redirect\" title=\"\u0414\u0436\u043e\u0440\u0434\u0436 \u0413\u0435\u0440\u0448\u0432\u0438\u043d\">\u0414\u0436\u043e\u0440\u0434\u0436\u0430 \u0413\u0435\u0440\u0448\u0432\u0438\u043d\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%BF%D1%81%D0%BE%D0%B4%D0%B8%D1%8F_%D0%B2_%D1%81%D1%82%D0%B8%D0%BB%D0%B5_%D0%B1%D0%BB%D1%8E%D0%B7\" title=\"\u0420\u0430\u043f\u0441\u043e\u0434\u0438\u044f \u0432 \u0441\u0442\u0438\u043b\u0435 \u0431\u043b\u044e\u0437\">\u00ab\u0413\u043e\u043b\u0443\u0431\u0430\u044f \u0440\u0430\u043f\u0441\u043e\u0434\u0438\u044f\u00bb<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1925_%D0%B3%D0%BE%D0%B4\" title=\"1925 \u0433\u043e\u0434\">1925<\/a>&#160;\u2014 \u043e\u0431\u0440\u0430\u0437\u043e\u04