 title=\"\u041b\u0430\u0442\u0438\u043d\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u043b\u0430\u0442\u044b\u043d\u0438<\/a> \u0442\u0440\u0430\u043d\u0441\u043b\u0438\u0440\u043e\u0432\u0430\u043b\u0430\u0441\u044c \u043d\u0430 \u0432\u0435\u0441\u044c \u043c\u0438\u0440.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933\" class=\"mw-redirect\" title=\"1933\">1933<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%BE%D0%B2%D0%B0%D0%B2%D0%BE%D0%B5_%D0%B2%D0%BE%D1%81%D0%BA%D1%80%D0%B5%D1%81%D0%B5%D0%BD%D1%8C%D0%B5_(1933)\" title=\"\u041a\u0440\u043e\u0432\u0430\u0432\u043e\u0435 \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u0435\u043d\u044c\u0435 (1933)\">\u0410\u0439\u0441\u043b\u0435\u0431\u0435\u043d\u0441\u043a\u043e\u0435 \u043a\u0440\u043e\u0432\u0430\u0432\u043e\u0435 \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u0435\u043d\u044c\u0435<\/a>. 600 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D1%82%D1%83%D1%80%D0%BC%D0%BE%D0%B2%D1%8B%D0%B5_%D0%BE%D1%82%D1%80%D1%8F%D0%B4%D1%8B_(%D0%A1%D0%90)\" class=\"mw-redirect\" title=\"\u0428\u0442\u0443\u0440\u043c\u043e\u0432\u044b\u0435 \u043e\u0442\u0440\u044f\u0434\u044b (\u0421\u0410)\">\u0448\u0442\u0443\u0440\u043c\u043e\u0432\u0438\u043a\u043e\u0432<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1\" title=\"\u0421\u0421\">\u044d\u0441\u044d\u0441\u043e\u0432\u0446\u0435\u0432<\/a> \u0432\u043e\u0440\u0432\u0430\u043b\u0438\u0441\u044c \u0432 \u043e\u0434\u043d\u0443 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%BC%D0%BD%D0%B0%D0%B7%D0%B8%D1%8F\" title=\"\u0413\u0438\u043c\u043d\u0430\u0437\u0438\u044f\">\u0433\u0438\u043c\u043d\u0430\u0437\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B9%D1%81%D0%BB%D0%B5%D0%B1%D0%B5%D0%BD\" class=\"mw-redirect\" title=\"\u0410\u0439\u0441\u043b\u0435\u0431\u0435\u043d\">\u0410\u0439\u0441\u043b\u0435\u0431\u0435\u043d\u0430<\/a>, \u0433\u0434\u0435 \u0432 \u044d\u0442\u043e \u0432\u0440\u0435\u043c\u044f \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u043b\u0430 \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u044f \u043f\u043e\u0441\u0432\u044f\u0449\u0435\u043d\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%80%D1%88%D0%B5%D0%BD%D0%BD%D0%BE%D0%BB%D0%B5%D1%82%D0%B8%D0%B5\" title=\"\u0421\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u043e\u043b\u0435\u0442\u0438\u0435\">\u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u043e\u043b\u0435\u0442\u0438\u0435<\/a> \u0447\u043b\u0435\u043d\u043e\u0432 \u043c\u043e\u043b\u043e\u0434\u0451\u0436\u043d\u043e\u0439 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438\">\u041a\u041f\u0413<\/a>. \u0412 \u0445\u043e\u0434\u0435 \u043d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u044f 25 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u043e \u0441\u0435\u0440\u044c\u0451\u0437\u043d\u044b\u0435 \u0440\u0430\u043d\u0435\u043d\u0438\u044f, \u0430 \u0442\u0440\u043e\u0435 \u0431\u044b\u043b\u0438 \u0443\u0431\u0438\u0442\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934\" class=\"mw-redirect\" title=\"1934\">1934<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D0%B8\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0410\u0432\u0441\u0442\u0440\u0438\u0438\">\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0410\u0432\u0441\u0442\u0440\u0438\u0438<\/a>: \u041e\u0431\u044b\u0441\u043a \u0432 \u0448\u0442\u0430\u0431-\u043a\u0432\u0430\u0440\u0442\u0438\u0440\u0435 \u0441\u043e\u0446\u0438\u0430\u043b-\u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u043e\u0432 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%BD%D1%86\" title=\"\u041b\u0438\u043d\u0446\">\u041b\u0438\u043d\u0446\u0435<\/a> \u0441\u043f\u0440\u043e\u0432\u043e\u0446\u0438\u0440\u043e\u0432\u0430\u043b \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u043e\u0435 \u0441\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u0435 \u043c\u0435\u0436\u0434\u0443 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c\u0438 \u0441\u0438\u043b\u0430\u043c\u0438 \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%88%D1%83%D1%86%D0%B1%D1%83%D0%BD%D0%B4\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0448\u0443\u0446\u0431\u0443\u043d\u0434\">\u0431\u043e\u0435\u0432\u0438\u043a\u0430\u043c\u0438 \u0437\u0430\u043f\u0440\u0435\u0449\u0451\u043d\u043d\u044b\u0445 \u043b\u0435\u0432\u044b\u0445 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0439<\/a>. \u041a\u043e\u043d\u0444\u043b\u0438\u043a\u0442 \u043e\u0445\u0432\u0430\u0442\u0438\u043b \u043a\u0440\u0443\u043f\u043d\u044b\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%B0%D0%B2%D1%81%D1%82%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" class=\"mw-redirect\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u0430\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0410\u0432\u0441\u0442\u0440\u0438\u0438<\/a>, \u043f\u0440\u0435\u0436\u0434\u0435 \u0432\u0441\u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B0\" title=\"\u0412\u0435\u043d\u0430\">\u0412\u0435\u043d\u0443<\/a>, \u0433\u0434\u0435 \u043b\u0435\u0432\u044b\u0435 \u0431\u043e\u0435\u0432\u0438\u043a\u0438 \u0437\u0430\u0431\u0430\u0440\u0440\u0438\u043a\u0430\u0434\u0438\u0440\u043e\u0432\u0430\u043b\u0438\u0441\u044c \u0432 \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u043a\u0432\u0430\u0440\u0442\u0430\u043b\u0430\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938\" class=\"mw-redirect\" title=\"1938\">1938<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%88%D0%BB%D1%8E%D1%81\" title=\"\u0410\u043d\u0448\u043b\u044e\u0441\">\u0410\u043d\u0448\u043b\u044e\u0441 \u0410\u0432\u0441\u0442\u0440\u0438\u0438<\/a>: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D1%86%D0%BB%D0%B5%D1%80_%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D0%B8\" class=\"mw-redirect\" title=\"\u041a\u0430\u043d\u0446\u043b\u0435\u0440 \u0410\u0432\u0441\u0442\u0440\u0438\u0438\">\u041a\u0430\u043d\u0446\u043b\u0435\u0440 \u0410\u0432\u0441\u0442\u0440\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D1%83%D1%88%D0%BD%D0%B8%D0%B3,_%D0%9A%D1%83%D1%80%D1%82\" title=\"\u0428\u0443\u0448\u043d\u0438\u0433, \u041a\u0443\u0440\u0442\">\u0428\u0443\u0448\u043d\u0438\u0433<\/a> \u0431\u044b\u043b \u0432\u044b\u0437\u0432\u0430\u043d \u0432 \u0433\u0438\u0442\u043b\u0435\u0440\u043e\u0432\u0441\u043a\u0443\u044e \u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0446\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D1%85%D1%82%D0%B5%D1%81%D0%B3%D0%B0%D0%B4%D0%B5%D0%BD\" title=\"\u0411\u0435\u0440\u0445\u0442\u0435\u0441\u0433\u0430\u0434\u0435\u043d\">\u0411\u0435\u0440\u0445\u0442\u0435\u0441\u0433\u0430\u0434\u0435\u043d<\/a>, \u0433\u0434\u0435 \u043f\u043e\u0434 \u0443\u0433\u0440\u043e\u0437\u043e\u0439 \u043d\u0435\u043c\u0435\u0434\u043b\u0435\u043d\u043d\u043e\u0433\u043e \u0432\u043e\u0435\u043d\u043d\u043e\u0433\u043e \u0432\u0442\u043e\u0440\u0436\u0435\u043d\u0438\u044f \u0431\u044b\u043b \u0432\u044b\u043d\u0443\u0436\u0434\u0435\u043d \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u0442\u044c \u043f\u0440\u0435\u0434\u044a\u044f\u0432\u043b\u0435\u043d\u043d\u044b\u0439 \u0435\u043c\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BB%D1%8C%D1%82%D0%B8%D0%BC%D0%B0%D1%82%D1%83%D0%BC\" title=\"\u0423\u043b\u044c\u0442\u0438\u043c\u0430\u0442\u0443\u043c\">\u0443\u043b\u044c\u0442\u0438\u043c\u0430\u0442\u0443\u043c<\/a> \u0438\u0437 \u0442\u0440\u0451\u0445 \u043f\u0443\u043d\u043a\u0442\u043e\u0432, \u0444\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0441\u0442\u0430\u0432\u0438\u0432\u0448\u0438\u0439 \u0441\u0442\u0440\u0430\u043d\u0443 \u043f\u043e\u0434 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438 \u0438 \u043f\u0440\u0435\u0432\u0440\u0430\u0449\u0430\u0432\u0448\u0438\u0439 \u0435\u0451 \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0432 \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D1%82%D0%B8%D0%B9_%D1%80%D0%B5%D0%B9%D1%85\" title=\"\u0422\u0440\u0435\u0442\u0438\u0439 \u0440\u0435\u0439\u0445\">\u0422\u0440\u0435\u0442\u044c\u0435\u0433\u043e \u0440\u0435\u0439\u0445\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939\" class=\"mw-redirect\" title=\"1939\">1939<\/a>&#160;\u2014 \u0421\u043e\u0441\u0442\u043e\u044f\u043b\u0438\u0441\u044c \u043f\u0435\u0440\u0432\u044b\u0435 \u0432\u044b\u0431\u043e\u0440\u044b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B9%D0%BC_%D0%9A%D0%B0%D1%80%D0%BF%D0%B0%D1%82%D1%81%D0%BA%D0%BE%D0%B9_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B\" title=\"\u0421\u0435\u0439\u043c \u041a\u0430\u0440\u043f\u0430\u0442\u0441\u043a\u043e\u0439 \u0423\u043a\u0440\u0430\u0438\u043d\u044b\">\u0441\u0435\u0439\u043c \u041a\u0430\u0440\u043f\u0430\u0442\u0441\u043a\u043e\u0439 \u0423\u043a\u0440\u0430\u0438\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BE%D0%B0%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0421\u0435\u0432\u0435\u0440\u043e\u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u044f\">\u0421\u0435\u0432\u0435\u0440\u043e\u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u044f<\/a>: \u041f\u0435\u0440\u0435\u0434\u043e\u0432\u044b\u0435 \u043f\u043e\u0434\u0440\u0430\u0437\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u043d\u0435\u043c\u0435\u0446\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BE%D1%80%D0%BF%D1%83%D1%81\" class=\"mw-redirect\" title=\"\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u043f\u0443\u0441\">\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u0440\u043f\u0443\u0441\u0430<\/a> \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%BC%D0%BC%D0%B5%D0%BB%D1%8C,_%D0%AD%D1%80%D0%B2%D0%B8%D0%BD\" title=\"\u0420\u043e\u043c\u043c\u0435\u043b\u044c, \u042d\u0440\u0432\u0438\u043d\">\u0420\u043e\u043c\u043c\u0435\u043b\u044f<\/a> \u0432\u044b\u0441\u0430\u0434\u0438\u043b\u0438\u0441\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B8%D0%BF%D0%BE%D0%BB%D0%B8\" title=\"\u0422\u0440\u0438\u043f\u043e\u043b\u0438\">\u0422\u0440\u0438\u043f\u043e\u043b\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BD%D0%B7%D0%B8%D0%BB%D0%BF%D0%B5%D0%BD%D0%B8%D1%86%D0%B8%D0%BB%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u043d\u0437\u0438\u043b\u043f\u0435\u043d\u0438\u0446\u0438\u043b\u043b\u0438\u043d\">\u041f\u0435\u043d\u0438\u0446\u0438\u043b\u043b\u0438\u043d<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0443\u0441\u043f\u0435\u0448\u043d\u043e \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f \u0438\u0437\u043b\u0435\u0447\u0435\u043d\u0438\u044f \u0431\u043e\u043b\u044c\u043d\u043e\u0433\u043e.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942\" class=\"mw-redirect\" title=\"1942\">1942<\/a>&#160;\u2014 \u041f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BC%D0%B8%D1%82%D0%B5%D1%82_%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D1%8B\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u043a\u043e\u043c\u0438\u0442\u0435\u0442 \u043e\u0431\u043e\u0440\u043e\u043d\u044b\">\u0413\u041a\u041e<\/a> \u043d\u0430 \u0432\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438\u043d\u044f\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/76-%D0%BC%D0%BC_%D0%B4%D0%B8%D0%B2%D0%B8%D0%B7%D0%B8%D0%BE%D0%BD%D0%BD%D0%B0%D1%8F_%D0%BF%D1%83%D1%88%D0%BA%D0%B0_%D0%BE%D0%B1%D1%80%D0%B0%D0%B7%D1%86%D0%B0_1942_%D0%B3%D0%BE%D0%B4%D0%B0_(%D0%97%D0%98%D0%A1-3)\" title=\"76-\u043c\u043c \u0434\u0438\u0432\u0438\u0437\u0438\u043e\u043d\u043d\u0430\u044f \u043f\u0443\u0448\u043a\u0430 \u043e\u0431\u0440\u0430\u0437\u0446\u0430 1942 \u0433\u043e\u0434\u0430 (\u0417\u0418\u0421-3)\">76-\u043c\u043c \u0434\u0438