kipedia.org\/wiki\/%D0%91%D1%83%D0%B4%D0%B0%D0%BF%D0%B5%D1%88%D1%82\" title=\"\u0411\u0443\u0434\u0430\u043f\u0435\u0448\u0442\">\u0411\u0443\u0434\u0430\u043f\u0435\u0448\u0442\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%B4%D0%B0\" title=\"\u0411\u0443\u0434\u0430\">\u0411\u0443\u0434\u0430<\/a>), \u0437\u0430\u043d\u044f\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%B4%D0%B0_(%D0%B7%D0%B0%D0%BC%D0%BE%D0%BA)\" class=\"mw-redirect\" title=\"\u0411\u0443\u0434\u0430 (\u0437\u0430\u043c\u043e\u043a)\">\u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0439 \u0437\u0430\u043c\u043e\u043a \u0438 \u0441\u0442\u0430\u0440\u0443\u044e \u043a\u0440\u0435\u043f\u043e\u0441\u0442\u044c<\/a>.<\/li><li><a href=\"https:\/\/el.wikipedia.org\/wiki\/%CE%A3%CF%85%CE%BC%CF%86%CF%89%CE%BD%CE%AF%CE%B1_%CF%84%CE%B7%CF%82_%CE%92%CE%AC%CF%81%CE%BA%CE%B9%CE%B6%CE%B1%CF%82\" class=\"extiw\" title=\"el:\u03a3\u03c5\u03bc\u03c6\u03c9\u03bd\u03af\u03b1 \u03c4\u03b7\u03c2 \u0392\u03ac\u03c1\u03ba\u03b9\u03b6\u03b1\u03c2\">\u0412\u0430\u0440\u043a\u0438\u0437\u0441\u043a\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435<\/a>, \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u043e \u0432 <a href=\"https:\/\/el.wikipedia.org\/wiki\/%CE%92%CE%AC%CF%81%CE%BA%CE%B9%CE%B6%CE%B1_%CE%91%CF%84%CF%84%CE%B9%CE%BA%CE%AE%CF%82\" class=\"extiw\" title=\"el:\u0392\u03ac\u03c1\u03ba\u03b9\u03b6\u03b1 \u0391\u03c4\u03c4\u03b9\u03ba\u03ae\u03c2\">\u0412\u0430\u0440\u043a\u0438\u0437\u0435<\/a>, \u0431\u043b\u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D0%B8%D0%BD%D1%8B\" title=\"\u0410\u0444\u0438\u043d\u044b\">\u0410\u0444\u0438\u043d<\/a>, \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE-%D0%BE%D1%81%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%84%D1%80%D0%BE%D0%BD%D1%82_%D0%93%D1%80%D0%B5%D1%86%D0%B8%D0%B8\" title=\"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e-\u043e\u0441\u0432\u043e\u0431\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u0444\u0440\u043e\u043d\u0442 \u0413\u0440\u0435\u0446\u0438\u0438\">\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e-\u043e\u0441\u0432\u043e\u0431\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c \u0444\u0440\u043e\u043d\u0442\u043e\u043c \u0413\u0440\u0435\u0446\u0438\u0438 (\u042d\u0410\u041c)<\/a> \u0438 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BB%D0%B0%D1%81%D1%82%D0%B8%D1%80%D0%B0%D1%81,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%BE%D1%81\" title=\"\u041f\u043b\u0430\u0441\u0442\u0438\u0440\u0430\u0441, \u041d\u0438\u043a\u043e\u043b\u0430\u043e\u0441\">\u041d. \u041f\u043b\u0430\u0441\u0442\u0438\u0440\u0430\u0441\u0430<\/a> \u043f\u043e\u0441\u043b\u0435 50-\u0434\u043d\u0435\u0432\u043d\u043e\u0433\u043e \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u043e\u0433\u043e \u0441\u043e\u043f\u0440\u043e\u0442\u0438\u0432\u043b\u0435\u043d\u0438\u044f \u0433\u0440\u0435\u0447\u0435\u0441\u043a\u0438\u0445 \u043b\u0435\u0432\u044b\u0445 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u043c \u0432\u043e\u0439\u0441\u043a\u0430\u043c \u0438 \u0438\u0445 \u0441\u043e\u044e\u0437\u043d\u0438\u043a\u0430\u043c \u0432 \u0413\u0440\u0435\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BA%D0%BA%D0%B5%D1%80,_%D0%90%D1%85%D0%B8%D0%BB%D0%BB_%D0%B2%D0%B0%D0%BD\" title=\"\u0410\u043a\u043a\u0435\u0440, \u0410\u0445\u0438\u043b\u043b \u0432\u0430\u043d\">\u0410\u0445\u0438\u043b\u043b \u0432\u0430\u043d \u0410\u043a\u043a\u0435\u0440<\/a> \u0437\u0430\u043d\u044f\u043b \u043f\u043e\u0441\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%BC%D1%8C%D0%B5%D1%80-%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D1%8B_%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D0%B8%D0%B8\" title=\"\u041f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u044b \u0411\u0435\u043b\u044c\u0433\u0438\u0438\">\u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430 \u0411\u0435\u043b\u044c\u0433\u0438\u0438<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946\" class=\"mw-redirect\" title=\"1946\">1946<\/a>&#160;\u2014 \u0417\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%C2%AB%D0%94%D1%8D%D0%B4%D0%BB%D0%B0%D0%B9%D1%82%C2%BB\" title=\"\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00ab\u0414\u044d\u0434\u043b\u0430\u0439\u0442\u00bb\">\u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00ab\u0414\u044d\u0434\u043b\u0430\u0439\u0442\u00bb<\/a> \u043f\u043e \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B8%D0%B3%D0%B8%D1%82%D0%BB%D0%B5%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%B0%D0%BB%D0%B8%D1%86%D0%B8%D1%8F\" title=\"\u0410\u043d\u0442\u0438\u0433\u0438\u0442\u043b\u0435\u0440\u043e\u0432\u0441\u043a\u0430\u044f \u043a\u043e\u0430\u043b\u0438\u0446\u0438\u044f\">\u0441\u0438\u043b\u0430\u043c\u0438 \u0441\u043e\u044e\u0437\u043d\u0438\u043a\u043e\u0432<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%BE%D1%84%D0%B5%D0%B9_(%D0%B4%D0%BE%D0%B1%D1%8B%D1%87%D0%B0)\" title=\"\u0422\u0440\u043e\u0444\u0435\u0439 (\u0434\u043e\u0431\u044b\u0447\u0430)\">\u0442\u0440\u043e\u0444\u0435\u0439\u043d\u044b\u0445<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D1%82%D0%B8%D0%B9_%D1%80%D0%B5%D0%B9%D1%85\" title=\"\u0422\u0440\u0435\u0442\u0438\u0439 \u0440\u0435\u0439\u0445\">\u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0445<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%BB%D0%BE%D0%B4%D0%BA%D0%B0\" title=\"\u041f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430\">\u043f\u043e\u0434\u0432\u043e\u0434\u043d\u044b\u0445 \u043b\u043e\u0434\u043e\u043a<\/a> \u0432 \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u043c \u0432 \u0433\u043b\u0443\u0431\u043e\u043a\u0438\u0445 \u0433\u0430\u0432\u0430\u043d\u044f\u0445 \u041b\u0438\u0441\u0430\u0445\u0430\u043b\u043b\u0438, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%98%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0418\u0440\u043b\u0430\u043d\u0434\u0438\u044f\">\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0418\u0440\u043b\u0430\u043d\u0434\u0438\u044f<\/a>, \u0438 \u041b\u043e\u0445-\u0420\u0438\u044d\u043d, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f\">\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f<\/a>. \u0418\u0437 154 \u043a\u0430\u043f\u0438\u0442\u0443\u043b\u0438\u0440\u043e\u0432\u0430\u0432\u0448\u0438\u0445 \u0441\u0443\u0431\u043c\u0430\u0440\u0438\u043d 121 \u0431\u044b\u043b\u0430 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u0430, \u043e\u0441\u0442\u0430\u043b\u044c\u043d\u044b\u0435 33 \u0431\u044b\u043b\u0438 \u043f\u043e\u0434\u0435\u043b\u0435\u043d\u044b \u043c\u0435\u0436\u0434\u0443 \u0441\u043e\u044e\u0437\u043d\u0438\u043a\u0430\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1947_%D0%B3%D0%BE%D0%B4\" title=\"1947 \u0433\u043e\u0434\">1947<\/a>&#160;\u2014 \u043f\u0430\u0434\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D1%85%D0%BE%D1%82%D1%8D-%D0%90%D0%BB%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D0%B5%D0%BE%D1%80%D0%B8%D1%82\" title=\"\u0421\u0438\u0445\u043e\u0442\u044d-\u0410\u043b\u0438\u043d\u0441\u043a\u0438\u0439 \u043c\u0435\u0442\u0435\u043e\u0440\u0438\u0442\">\u0421\u0438\u0445\u043e\u0442\u044d-\u0410\u043b\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u043c\u0435\u0442\u0435\u043e\u0440\u0438\u0442\u0430<\/a> \u0432 \u0433\u043e\u0440\u0430\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D1%85%D0%BE%D1%82%D1%8D-%D0%90%D0%BB%D0%B8%D0%BD%D1%8C\" title=\"\u0421\u0438\u0445\u043e\u0442\u044d-\u0410\u043b\u0438\u043d\u044c\">\u0421\u0438\u0445\u043e\u0442\u044d-\u0410\u043b\u0438\u043d\u044c<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA\" title=\"\u0421\u043e\u044e\u0437 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\">\u0421\u0421\u0421\u0420<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1949\" class=\"mw-redirect\" title=\"1949\">1949<\/a>&#160;\u2014 \u041e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u044c \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0439 \u0440\u0435\u043b\u0438\u0433\u0438\u043e\u0437\u043d\u043e-\u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0430\u0441\u0441\u043e\u0446\u0438\u0430\u0446\u0438\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D1%82%D1%8C%D1%8F-%D0%BC%D1%83%D1%81%D1%83%D0%BB%D1%8C%D0%BC%D0%B0%D0%BD%D0%B5\" title=\"\u0411\u0440\u0430\u0442\u044c\u044f-\u043c\u0443\u0441\u0443\u043b\u044c\u043c\u0430\u043d\u0435\">\u0411\u0440\u0430\u0442\u044c\u044f-\u043c\u0443\u0441\u0443\u043b\u044c\u043c\u0430\u043d\u0435<\/a>\u00bb, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C-%D0%91%D0%B0%D0%BD%D0%BD%D0%B0,_%D0%A5%D0%B0%D1%81%D0%B0%D0%BD\" title=\"\u0410\u043b\u044c-\u0411\u0430\u043d\u043d\u0430, \u0425\u0430\u0441\u0430\u043d\">\u0425\u0430\u0441\u0430\u043d \u0430\u043b\u044c-\u0411\u0430\u043d\u043d\u0430<\/a> \u0437\u0430\u0441\u0442\u0440\u0435\u043b\u0435\u043d \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B8%D1%80\" title=\"\u041a\u0430\u0438\u0440\">\u041a\u0430\u0438\u0440\u0435<\/a>, \u0435\u0433\u043e \u0443\u0431\u0438\u0439\u0446\u0430 \u0442\u0430\u043a \u0438 \u043d\u0435 \u0431\u044b\u043b \u043f\u043e\u0439\u043c\u0430\u043d.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a>&#160;\u2014 23 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u043c\u0438 \u0442\u0435\u043b\u0435- \u0438 \u0440\u0430\u0434\u0438\u043e\u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f\u043c\u0438 \u0441\u0440\u0435\u0434\u0438\u0437\u0435\u043c\u043d\u043e\u043c\u043e\u0440\u0441\u043a\u043e\u0433\u043e \u0440\u0435\u0433\u0438\u043e\u043d\u0430 \u043d\u0430 \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u0438 \u0432 \u043a\u0443\u0440\u043e\u0440\u0442\u043d\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D1%80%D0%BA%D0%B8_(%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F)\" title=\"\u0422\u043e\u0440\u043a\u0438 (\u0410\u043d\u0433\u043b\u0438\u044f)\">\u0422\u043e\u0440\u043a\u0438<\/a>, \u0433\u0440\u0430\u0444\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%B2%D0%BE%D0%BD_(%D0%B3%D1%80%D0%B0%D1%84%D1%81%D1%82%D0%B2%D0%BE)\" title=\"\u0414\u0435\u0432\u043e\u043d (\u0433\u0440\u0430\u0444\u0441\u0442\u0432\u043e)\">\u0414\u0435\u0432\u043e\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f<\/a>, \u0441\u043e\u0437\u0434\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%B2%D0%B5%D1%89%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%81%D0%BE%D1%8E%D0%B7\" title=\"\u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0439 \u0432\u0435\u0449\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u0441\u043e\u044e\u0437\">\u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0439 \u0432\u0435\u0449\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u0441\u043e\u044e\u0437<\/a>, \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0435\u0435 \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0435 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0445 \u0432\u0435\u0449\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0439 \u0432 \u043c\u0438\u0440\u0435. \u0415\u0412\u0421 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0442\u043e\u0440\u043e\u043c \u0435\u0436\u0435\u0433\u043e\u0434\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D0%BA%D1%83%D1%80%D1%81_%D0%BF%D0%B5%D1%81%D0%BD%D0%B8_%D0%95%D0%B2%D1%80%D0%BE%D0%B2%D0%B8%D0%B4%D0%B5%D0%BD%D0%B8%D0%B5\" class=\"mw-redirect\" title=\"\u041a\u043e\u043d\u043a\u0443\u0440\u0441 \u043f\u0435\u0441\u043d\u0438 \u0415\u0432\u0440\u043e\u0432\u0438\u0434\u0435\u043d\u0438\u0435\">\u043a\u043e\u043d\u043a\u0443\u0440\u0441\u0430 \u043f\u0435\u0441\u043d\u0438 \u0415\u0432\u0440\u043e\u0432\u0438\u0434\u0435\u043d\u0438\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BE%D0%BD%D0%BA%D1%83%D1%80%D1%81_%D0%BF%D0%B5%D1%81%D0%BD%D0%B8_%D0%95%D0%B2%D1%80%D0%BE%D0%B2%D0%B8%D0%B4%D0%B5%D0%BD%D0%B8%D0%B5\" class=\"mw-redirect\" title=\"\u0414\u0435\u0442\u0441\u043a\u0438\u0439 \u043a\u043e\u043d\u043a\u0443\u0440\u0441 \u043f\u0435\u0441\u043d\u0438 \u0415\u0432\u0440\u043e\u0432\u0438\u0434\u0435\u043d\u0438\u0435\">\u0414\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u043d\u043a\u0443\u0440\u0441\u0430 \u043f\u0435\u0441\u043d\u0438 \u0415\u0432\u0440\u043e\u0432\u0438\u0434\u0435\u043d\u0438\u0435<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%BD%D1%86%D0%B5%D0%B2%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D0%95%D0%B2%D1%80%D0%BE%D0%B2%D0%B8%D0%B4%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0422\u0430\u043d\u0446\u0435\u0432\u0430\u043b\u044c\u043d\u043e\u0435 \u0415\u0432\u0440\u043e\u0432\u0438\u0434\u0435\u043d\u0438\u0435\">\u0422\u0430\u043d\u0446\u0435\u0432\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043a\u043e\u043d\u043a\u0443\u0440\u0441\u0430 \u0415\u0432\u0440\u043e\u0432\u0438\u0434\u0435\u043d\u0438\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1955_%D0%B3%D0%BE%D0%B4\" title=\"1955 \u0433\u043e\u0434\">1955<\/a>&#160;\u2014 \u041f\u0440\u0438\u043d\u044f\u0442\u043e \u041f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D0%BE%D0%B2_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u0421\u043e\u0432\u0435\u0442 \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 \u0421\u0421\u0421\u0420\">\u0421\u043e\u0432\u0435\u0442\u0430 \u041c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 \u0421\u0421\u0421\u0420<\/a> \u2116&#160;292\u2014181 \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u043f\u043e\u043b\u0438\u0433\u043e\u043d\u0430 \u043f\u043e \u0438\u0441\u043f\u044b\u0442\u0430\u043d\u0438\u044f\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B6%D0%BA%D0%BE%D0%BD%D1%82%D0%B8%D0%BD%D0%B5%D0%BD%D1%82%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%B1%D0%B0%D0%BB%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B0%D0%BA%D0%B5%D1%82%D0%B0\" title=\"\u041c\u0435\u0436\u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u0430\u044f \u0431\u0430\u043b\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0440\u0430\u043a\u0435\u0442\u0430\">\u043c\u0435\u0436\u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u043e\u0439 \u0431\u0430\u043b\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0440\u0430\u043a\u0435\u0442\u044b<\/a> \u0438 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BA%D1%83%D1%81%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D1%81%D0%BF%D1%83%D1%82%D0%BD%D0%B8%D0%BA_%D0%97%D0%B5%D0%BC%D0%BB%D0%B8\" title=\"\u0418\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0441\u043f\u0443\u0442\u043d\u0438\u043a \u0417\u0435\u043c\u043b\u0438\">\u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u0441\u043f\u0443\u0442\u043d\u0438\u043a\u043e\u0432 \u0417\u0435\u043c\u043b\u0438<\/a>&#160;\u2014 \u043d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0438 \u0438\u0441\u043f\u044b\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u043e\u043b\u0438\u0433\u043e\u043d\u0430 \u2116&#160;5 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D0%B5%D1%80%D1%81%D1%82%D0%B2%D0%BE_%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D1%8B_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u041c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u043e \u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0421\u0421\u0421\u0420\">\u041c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u0430 \u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0421\u0421\u0421\u0420<\/a> (\u041d\u0418\u0418\u041f-5). \u041c\u0435\u0441\u0442\u043e\u043c \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u0431\u044b\u043b \u0432\u044b\u0431\u0440\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B7%D0%B0%D1%85%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u041a\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043d\">\u041a\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043d<\/a>. \u041d\u044b\u043d\u0435 \u043f\u043e\u043b\u0438\u0433\u043e\u043d \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961 \u0433\u043e\u0434\u0430<\/a> \u0438\u0437\u0432\u0435\u0441\u0442\u0435\u043d \u043a\u0430\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%81%D0%BC%D0%BE%D0%B4%D1%80%D0%BE%D0%BC\" title=\"\u041a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c\">\u043a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B9%D0%BA%D0%BE%D0%BD%D1%83%D1%80\" title=\"\u0411\u0430\u0439\u043a\u043e\u043d\u0443\u0440\">\u0411\u0430\u0439\u043a\u043e\u043d\u0443\u0440<\/a>. \u0414\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u043e\u043c \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d \u0433\u0435\u043d\u0435\u0440\u0430\u043b \u0410.&#160;\u0418.&#160;\u041d\u0435\u0441\u0442\u0435\u0440\u0435\u043d\u043a\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1957_%D0%B3%D0%BE%D0%B4\" title=\"1957 \u0433\u043e\u0434\">1957<\/a>&#160;\u2014 \u0420\u043e\u0431\u0435\u0440\u0442 \u0412\u0435\u043d\u0442\u043e\u0440\u0444 \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D1%8C%D0%B1%D0%BE%D1%80\" title=\"\u042d\u043b\u044c\u0431\u043e\u0440\">\u0431\u043e\u0440\u0430\u0437\u043e\u043d<\/a> (\u043a\u0443\u0431\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043d\u0438\u0442\u0440\u0438\u0434 \u0431\u043e\u0440\u0430)&#160;\u2014 \u043e\u0434\u0438\u043d \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0442\u0432\u0451\u0440\u0434\u044b\u0445 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u043e\u0432 \u043d\u0430 \u0417\u0435\u043c\u043b\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1958\" class=\"mw-redirect\" title=\"1958\">1958<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9\" class=\"mw-redirect\" title=\"\u041a\u0438\u0442\u0430\u0439\">\u041a\u0438\u0442\u0430\u0435<\/a>, \u0432 \u0440\u0430\u043c\u043a\u0430\u0445 \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9_%D1%81%D0%BA%D0%B0%D1%87%D0%BE%D0%BA\" title=\"\u0411\u043e\u043b\u044c\u0448\u043e\u0439 \u0441\u043a\u0430\u0447\u043e\u043a\">\u0411\u043e\u043b\u044c\u0448\u043e\u0433\u043e \u0441\u043a\u0430\u0447\u043a\u0430<\/a>, \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u043c\u0430\u0441\u0448\u0442\u0430\u0431\u043d\u0430\u044f \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u044f \u043f\u043e \u0431\u043e\u0440\u044c\u0431\u0435 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5_%D1%85%D0%BE%D0%B7%D1%8F%D0%B9%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0421\u0435\u043b\u044c\u0441\u043a\u043e\u0435 \u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u043e\">\u0441\u0435\u043b\u044c\u0441\u043a\u043e\u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c\u0438<\/a> \u0432\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u044f\u043c\u0438. \u0417\u0430\u043c\u044b\u0441\u0435\u043b \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u0438 \u0431\u044b\u043b \u0432 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u0438\u0438 \u00ab\u0447\u0435\u0442\u044b\u0440\u0451\u0445 \u0432\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u0435\u0439\u00bb&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%8B%D1%81%D1%8B\" title=\"\u041a\u0440\u044b\u0441\u044b\">\u043a\u0440\u044b\u0441<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%B0%D1%80%D1%8B\" title=\"\u041a\u043e\u043c\u0430\u0440\u044b\">\u043a\u043e\u043c\u0430\u0440\u043e\u0432<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D1%85%D0%B8\" title=\"\u041c\u0443\u0445\u0438\">\u043c\u0443\u0445<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D0%B5%D0%B2%D0%BE%D0%B9_%D0%B2%D0%BE%D1%80%D0%BE%D0%B1%D0%B5%D0%B9\" title=\"\u041f\u043e\u043b\u0435\u0432\u043e\u0439 \u0432\u043e\u0440\u043e\u0431\u0435\u0439\">\u0432\u043e\u0440\u043e\u0431\u044c\u0451\u0432<\/a>. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BD%D0%B8%D1%87%D1%82%D0%BE%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%B2%D0%BE%D1%80%D0%BE%D0%B1%D1%8C%D1%91%D0%B2\" title=\"\u0423\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u0438\u0435 \u0432\u043e\u0440\u043e\u0431\u044c\u0451\u0432\">\u041a\u0430\u043c\u043f\u0430\u043d\u0438\u044f \u043f\u0440\u043e\u0442\u0438\u0432 \u0432\u043e\u0440\u043e\u0431\u044c\u0451\u0432<\/a> \u043f\u0440\u0438\u043d\u044f\u043b\u0430 \u043d\u0430\u0438\u0431\u043e\u043b\u0435\u0435 \u043c\u0430\u0441\u0441\u043e\u0432\u044b\u0439 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961<\/a>&#160;\u2014 \u0412 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u043c \u0421\u043e\u044e\u0437\u0435 \u0432 \u0441\u0442\u043e\u0440\u043e\u043d\u0443 \u043f\u043b\u0430\u043d\u0435\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B5%D1%80%D0%B0_(%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0)\" class=\"mw-redirect\" title=\"\u0412\u0435\u043d\u0435\u0440\u0430 (\u043f\u043b\u0430\u043d\u0435\u0442\u0430)\">\u0412\u0435\u043d\u0435\u0440\u0430<\/a> \u0437\u0430\u043f\u0443\u0449\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2