ipedia.org\/wiki\/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82%D0%BE%D0%B2_%D0%91%D0%B0%D0%BD%D0%B3%D0%BB%D0%B0%D0%B4%D0%B5%D1%88\" title=\"\u0421\u043f\u0438\u0441\u043e\u043a \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u0432 \u0411\u0430\u043d\u0433\u043b\u0430\u0434\u0435\u0448\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c \u0411\u0430\u043d\u0433\u043b\u0430\u0434\u0435\u0448<\/a> \u0431\u0435\u0437 \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2010_%D0%B3%D0%BE%D0%B4\" title=\"2010 \u0433\u043e\u0434\">2010<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BD%D0%BA%D1%83%D0%B2%D0%B5%D1%80\" title=\"\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440\">\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B8%D0%BC%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B_2010\" title=\"\u0417\u0438\u043c\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b 2010\">XXI \u0437\u0438\u043c\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b<\/a>. \u0423\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u0438 \u0438 \u0433\u043e\u0441\u0442\u0438 \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u0438 \u043f\u043e\u0447\u0442\u0438\u043b\u0438 \u043c\u0438\u043d\u0443\u0442\u043e\u0439 \u043c\u043e\u043b\u0447\u0430\u043d\u0438\u044f \u043f\u0430\u043c\u044f\u0442\u044c \u0433\u0440\u0443\u0437\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0441\u043f\u043e\u0440\u0442\u0441\u043c\u0435\u043d\u0430-\u0441\u0430\u043d\u043e\u0447\u043d\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%BC%D0%B0%D1%80%D0%B8%D1%82%D0%B0%D1%88%D0%B2%D0%B8%D0%BB%D0%B8,_%D0%9D%D0%BE%D0%B4%D0%B0%D1%80_%D0%94%D0%B0%D0%B2%D0%B8%D0%B4%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0443\u043c\u0430\u0440\u0438\u0442\u0430\u0448\u0432\u0438\u043b\u0438, \u041d\u043e\u0434\u0430\u0440 \u0414\u0430\u0432\u0438\u0434\u043e\u0432\u0438\u0447\">\u041d\u043e\u0434\u0430\u0440\u0430 \u041a\u0443\u043c\u0430\u0440\u0438\u0442\u0430\u0448\u0432\u0438\u043b\u0438<\/a>, \u043f\u043e\u0433\u0438\u0431\u0448\u0435\u0433\u043e \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0442\u0440\u0435\u043d\u0438\u0440\u043e\u0432\u043e\u0447\u043d\u043e\u0433\u043e \u0437\u0430\u0435\u0437\u0434\u0430 \u0432 \u044d\u0442\u043e\u0442 \u0436\u0435 \u0434\u0435\u043d\u044c.<\/li><li>\u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%88%D1%82%D0%B0%D1%80%D0%B0%D0%BA_(%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F)\" title=\"\u041c\u043e\u0448\u0442\u0430\u0440\u0430\u043a (\u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f)\">\u043a\u0440\u0443\u043f\u043d\u043e\u0439 \u043d\u0430\u0441\u0442\u0443\u043f\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u0438 \u041c\u043e\u0448\u0442\u0430\u0440\u0430\u043a \u0432 \u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\u0435<\/a>, \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0435\u0439 \u0441 \u043d\u0430\u0447\u0430\u043b\u0430 \u0432\u043e\u0439\u043d\u044b \u0432 2001 \u0433\u043e\u0434\u0443.<\/li><li>\u0412\u0441\u0442\u0443\u043f\u0438\u043b \u0432 \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u044c \u0432\u043e \u0432\u0442\u043e\u0440\u043e\u0439 \u0440\u0430\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\">\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442<\/a> \u0410\u0431\u0445\u0430\u0437\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B3%D0%B0%D0%BF%D1%88,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0430\u0433\u0430\u043f\u0448, \u0421\u0435\u0440\u0433\u0435\u0439 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447\">\u0421\u0435\u0440\u0433\u0435\u0439 \u0411\u0430\u0433\u0430\u043f\u0448<\/a>.<\/li><li>\u041f\u0440\u043e\u0444\u0435\u0441\u0441\u043e\u0440 \u0431\u0438\u043e\u043b\u043e\u0433\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B0%D0%B1%D0%B0%D0%BC%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82\" title=\"\u0410\u043b\u0430\u0431\u0430\u043c\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\">\u0410\u043b\u0430\u0431\u0430\u043c\u0441\u043a\u043e\u0433\u043e \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430<\/a> \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D0%BD%D1%82%D1%81%D0%B2%D0%B8%D0%BB%D0%BB_(%D0%90%D0%BB%D0%B0%D0%B1%D0%B0%D0%BC%D0%B0)\" title=\"\u0425\u0430\u043d\u0442\u0441\u0432\u0438\u043b\u043b (\u0410\u043b\u0430\u0431\u0430\u043c\u0430)\">\u0425\u0430\u043d\u0442\u0441\u0432\u0438\u043b\u043b<\/a> (\u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B0%D0%B1%D0%B0%D0%BC%D0%B0\" title=\"\u0410\u043b\u0430\u0431\u0430\u043c\u0430\">\u0410\u043b\u0430\u0431\u0430\u043c\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>), \u042d\u043c\u0438 \u0411\u0438\u0448\u043e\u043f, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D1%80%D0%B5%D0%BB%D1%8C%D0%B1%D0%B0_%D0%B2_%D0%90%D0%BB%D0%B0%D0%B1%D0%B0%D0%BC%D1%81%D0%BA%D0%BE%D0%BC_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82%D0%B5_%D0%B2_%D0%A5%D0%B0%D0%BD%D1%82%D1%81%D0%B2%D0%B8%D0%BB%D0%BB%D0%B5\" title=\"\u0421\u0442\u0440\u0435\u043b\u044c\u0431\u0430 \u0432 \u0410\u043b\u0430\u0431\u0430\u043c\u0441\u043a\u043e\u043c \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0435 \u0432 \u0425\u0430\u043d\u0442\u0441\u0432\u0438\u043b\u043b\u0435\">\u043e\u0442\u043a\u0440\u044b\u043b\u0430 \u0441\u0442\u0440\u0435\u043b\u044c\u0431\u0443<\/a> \u043d\u0430 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0438 \u043f\u0440\u0435\u043f\u043e\u0434\u0430\u0432\u0430\u0442\u0435\u043b\u0435\u0439 \u0431\u0438\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0444\u0430\u043a\u0443\u043b\u044c\u0442\u0435\u0442\u0430, \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0447\u0435\u0433\u043e \u043f\u043e\u0433\u0438\u0431\u043b\u0438 \u0442\u0440\u043e\u0435 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0438 \u0435\u0449\u0451 \u0442\u0440\u043e\u0435 \u0440\u0430\u043d\u0435\u043d\u044b.<\/li><\/ul><\/li><\/ul><h2>"}